import project1pic from '../../Assets/Project1.png'
import project2pic from '../../Assets/Project1.png'

export const ProjectCollection = [
    {
        id: 1,
        title: "IP tracker",
        about: "This web app is created to look up IP address and location.",
        tags: ["HTML", "CSS", "JavaScript"],
        github: "https://github.com/rakeshR03/IP-tracker",
        image: project1pic,
    },
    {
        id: 2,
        title: "Portfolio",
        about: "This is a portfolio website created to let you know about me.",
        tags: ["HTML", "CSS", "Reactjs"],
        github: "https://github.com/rakeshR03/My-portfolio",
        image: project2pic,
    }
];
